	function [R1n,R4n,R5n,R6n] = BOCTOR_HPF(R2n,R3n,C1n,C2n,wopn,wozn,Qp)	%	%	%	%	%	%	%	sl@tek.sdu.dk	%		clear BOCTOR_HPF;	syms R1n R4n R5n R6n;	f1=wopn==sqrt((R1n*R3n*R4n-R1n*R5n*R6n+R3n*R4n*R6n)/C1n/C2n/R1n/R2n/R3n/R4n/R6n);	f2=wopn/Qp==(C2n*R1n*R2n*R3n*R4n+C1n*R1n*R3n*R4n*R6n-C2n*R1n*R2n*R5n*R6n+C2n*R2n*R3n*R4n*R6n-C2n*R1n*R4n*R5n*R6n)/C1n/C2n/R1n/R2n/R3n/R4n/R6n;	f3=wozn==sqrt(1/C1n/C2n/R1n/R2n);	f4=0==(C1n*R1n*R3n*R4n*R6n-C2n*R1n*R3n*R4n*R5n+C1n*R1n*R3n*R5n*R6n+C2n*R2n*R3n*R4n*R6n-C2n*R1n*R4n*R5n*R6n+C2n*R2n*R3n*R5n*R6n);	RES=solve(f1,f2,f3,f4);	R1n=vpa(RES.R1n,7);	R4n=vpa(RES.R4n,7);	R5n=vpa(RES.R5n,7);	R6n=vpa(RES.R6n,7);	